import React, {useState} from "react";

const [count, setCount] = useState(0)

const Inc = () => {
    setCount(count + 1);
}

const App = () => {
    return(
        <>
            <h1> {count} </h1>
            <button onClick={Inc}> Click Me </button>
        </>
    )
}

export default App;
